import React from 'react';


import './App.css';
import {Route} from 'react-router-dom';
import Header from './components/Header/Header';
import Nav from './components/Nav/Nav';
import Profil from './components/Profil/Profil';
import Dialogs from './components/Dialogs/Dialogs';
import News from './components/News/News';
import Music from './components/Music/Music';
import Settings from './components/Settings/Settings';
import store, {ActionsTypes, StateType, StoreType} from "./Redux/redux-store";



const App: React.FC<StoreType> = (props) => {
    return (
        <div className='app-wrapper'>
            <Header/>
            <Nav friends={props._state.sidebar.friends}/>
            <div className='app-wrapper-content'>
                <Route path='/profil' render={() =>
                    <Profil
                    profilPage={props._state.profilPage}
                    dispatch={props.dispatch.bind(props._state)}/>}/>
                <Route path='/dialogs' render={() =>
                    <Dialogs
                        dialogPage={props._state.dialogPage}
                        dispatch={props.dispatch.bind(props._state)}/>}/>
                <Route path='/news' render={() => <News/>}/>
                <Route path='/music' render={() => <Music/>}/>
                <Route path='/settings' render={() => <Settings/>}/>
            </div>
        </div>
    );
}

export default App;
